import emptyCart from "./../../images/cart.svg";


const EmptyCart = () => {
    return ( 
        <main className="main">
        <div className="empty__cart">
            <button type="submit" className="purchase">Purchase</button>
            <figure className="figure__emp">
                <img src={emptyCart} alt="emptyCart" className="emptyCart" />
            </figure>
            <p className="figcaption__emp">Cart is empty...</p>
        </div>
        </main>
     );
}

export default EmptyCart;
